INSERT INTO `onl_cgform_enhance_js` VALUES ('5e9ccc1e2b977bdd5a873a6bd6311290', 'jihuo_hook(){\n  console.log(\'当前选中行的id\', this);\n  console.log(\'this.abc\', this.abc);\n   import {useMessage} from \"@/hooks/useMessage\"\n        const {createMessage} = useMessage()\n        function sayHi () {\n            createMessage.success(\"这是代码里的提示：hello world!\")\n        }\n        sayHi();\n}\n\n\n\ntest1(){\n  this.openCustomModal({\n    title: \'测试自定义弹框1\',\n    width: 800,\n     hide: [\'cc\']\n  });\n}\n\nsetup(){\n    console.log(\"进入form: \",this)\n    import { defineComponent, computed, CSSProperties, unref, ref, watchEffect, watch, PropType } from \'vue\';\n  \n  watch(name,(newValue,oldValue)=>{\n    console.log(\"新值是\"+newValue, \"旧址是\"+oldValue);\n  })\n  \n}', 'list', NULL, '9ab817fd4c2e4e7ba6652c4fa46af389');
INSERT INTO `onl_cgform_enhance_js` VALUES ('6dd82d8eac166627302230a809233481', 'ces_order_goods_onlChange(){\n    return {\n        num(){\n           \n            let id = event.row.id\n            let num = event.row.num\n            let price = event.row.price\n\n            let targrt = event.target\n            \n            let nval = price*num\n            console.log(\'row\',event.row);\n            console.log(\'num\',num);\n            console.log(\'that\',that);\n            let otherValues = {\'zong_price\': nval}\n              \n            that.triggleChangeValues(otherValues,id,targrt)\n   \n\n        }\n    }\n}', 'form', NULL, '56efb74326e74064b60933f6f8af30ea');
