INSERT INTO `onl_cgform_enhance_js` VALUES ('a0ca1d842f138ba2cda00bc44e95edd9', 'loaded(){\n  this.$nextTick(()=>{\n    let text = \'测试js增强设置默认值\';\n    if(this.isUpdate.value === true){\n      text = \'测试js增强修改表单值\';\n    }\n    this.setFieldsValue({\n      name: text\n    })\n  })\n}\n\n onlChange(){\n   return {\n    name(){\n      let value = event.value\n      let values = {\'dhwb\': \'我的名称是：\'+ value }\n      this.triggleChangeValues(values)\n    }\n  }\n }\n\nbeforeSubmit(row){\n	return new Promise((resolve, reject)=>{\n    //此处模拟等待时间，可能需要发起请求\n    setTimeout(()=>{\n      if(row.name == \'test\'){\n        // 当某个字段不满足要求的时候可以reject \n        reject(\'不能提交测试数据\');\n      }else{\n        resolve();\n      }\n    },3000)\n  })\n}', 'form', NULL, '553a4172fde446419cb602dc70f9ee67');
