INSERT INTO `sys_announcement` VALUES ('1714483541679247362', 'JeecgBoot3.6.0大版本发布', '<div class=\"logo-wrapper\"><img class=\"logo\" src=\"https://www.jeecg.com/images/logo.png\" alt=\"\" border=\"3\" /></div>\n<p class=\"introduce\">JEECG是一款基于BPM的低代码平台！前后端分离架构 SpringBoot 2.x，SpringCloud，Ant Design&amp;Vue，Mybatis-plus，Shiro，JWT，支持微服务。强大的代码生成器让前后端代码一键生成，实现低代码开发！ JeecgBoot引领新低代码开发模式 OnlineCoding-&gt; 代码生成器-&gt; 手工MERGE， 帮助Java项目解决70%的重复工作，让开发更多关注业务，既能快速提高效率，节省研发成本，同时又不失灵活性！一系列低代码能力：Online表单、Online报表、Online图表、表单设计、流程设计、报表设计、大屏设计 等等...</p>\n<p class=\"changelog\">当前版本 v3.5.5&nbsp;<a class=\"\" href=\"https://www.jeecg.com/doc/log\">更新日志&nbsp;</a><span class=\"githubCls\"><iframe src=\"https://jeecgos.oss-cn-beijing.aliyuncs.com/files/jeecgstar20230921.svg\" width=\"110\" height=\"20\" frameborder=\"0\" scrolling=\"0\" data-mce-fragment=\"1\"></iframe><iframe src=\"https://jeecgos.oss-cn-beijing.aliyuncs.com/files/jeecgfork20230921.svg\" width=\"110\" height=\"20\" frameborder=\"0\" scrolling=\"0\" data-mce-fragment=\"1\"></iframe></span></p>', NULL, '2023-12-31 11:27:55', 'ceshi', 'H', '1', 'ALL', '1', '2023-10-18 11:28:27', NULL, '0', NULL, NULL, NULL, NULL, 'ceshi', '2023-10-18 11:28:25', 'ceshi', '2023-10-18 11:28:27', '', '新版本发布', NULL, 0);
